    // >>> smallestChange((new ArrayList<Long>(Arrays.asList((long)1l, (long)2l, (long)3l, (long)2l, (long)1l))))
    // (0l)
    public static long smallestChange(ArrayList<Long> arr) {
        int n = arr.size();
        long changes = 0;
        for (int i = 0; i < n / 2; i++) {
            if (!arr.get(i).equals(arr.get(n - i - 1))) {
                changes++;
            }
        }
        return changes;

