                if (Character.isLowerCase(c)) {
                    encodedMessage.append(Character.toUpperCase(c));
                } else {
                    encodedMessage.append(Character.toLowerCase(c));
                }
            } else {
                encodedMessage.append(c);
            }
        }
        return encodedMessage.toString();

