    // (24l)
    // Constraints:
    // 1. 1 <= len(arr) <= 100
    // 2. 1 <= k <= len(arr)
    public static long addElements(ArrayList<Long> arr, long k) {
        long sum = 0;
        for (int i = 0; i < k; i++) {
            long num = arr.get(i);
            if (num >= 10 && num <= 99) {
                sum += num;
            }
        }
        return sum;

